//Установить уведомление
function set_mess($mess, $type)
{
    //danger - красное
    //primary - синее
    //success - зеленое
    //warning - желтое
    //
    $_SESSION['mess'] = $mess;
    $_SESSION['type']=$type;
    $_SESSION['status']=true;
}

