        {
            echo "<div class='col-xs-12 col-md-12 col-sm-12 col-lg-12'>
                <div class='alert alert-".$_SESSION['type']." text-center'>
                ".$_SESSION['mess']."
                </div>
            </div>";
            $_SESSION['status']=false;
            //danger
        }
}

